import Navbar from "react-bootstrap/Navbar";
import {Nav} from "react-bootstrap";

export default function Sidebar(){
    return (
        <div className="border-end bg-white" id="sidebar-wrapper">

            <div className="list-group list-group-flush w-25">
                <a className="list-group-item list-group-item-action list-group-item-light p-3" href="#!">Explore</a>
                <a className="list-group-item list-group-item-action list-group-item-light p-3" href="#!">Profile</a>
                <a className="list-group-item list-group-item-action list-group-item-light p-3" href="#!">Friend</a>
            </div>
        </div>
    );
};
